import React from "react";
import daysEnd from "../../images/days-end.jpg";
import motherSon from "../../images/mother-son.jpg";
import ProjectCard from "./project-card";

function BuiltProjects() {
  return (
    <>
      <ProjectCard title="MFAH" copy="stuff" source={daysEnd}></ProjectCard>
      <ProjectCard title="IAS" copy="stuff" source={daysEnd}></ProjectCard>
      <ProjectCard
        title="Day's End"
        copy="stuff"
        source={daysEnd}
      ></ProjectCard>
      <ProjectCard
        title="Mother and Son"
        copy="stuff"
        source={motherSon}
      ></ProjectCard>
      <ProjectCard title="LMC" copy="stuff" source={daysEnd}></ProjectCard>
      <ProjectCard title="MPK22" copy="stuff" source={daysEnd}></ProjectCard>
      <ProjectCard
        title="G5 Garage"
        copy="stuff"
        source={daysEnd}
      ></ProjectCard>
      <ProjectCard title="SLT" copy="stuff" source={daysEnd}></ProjectCard>
    </>
  );
}

export default BuiltProjects;
